import React from 'react';
import {connect} from 'react-redux'
import {SelectCollection, selectCollections} from '../../redux/shop/shop.selector'
import CollectionItem from '../../components/collection-items/collection-item'

import './collection.style.scss'

const Collection=({collection})=>{
    console.log(collection)
    return(
    <div className="category">
        <h2>Collection</h2>
    </div>
    )
}

const mapStateToProps = (state, ownProps) => {
    return {
        collection: selectCollections(ownProps.match.params.collectionId)(state)
    }
}
export default connect (mapStateToProps)(Collection)
